      <textColor reference="31"/>
      <text id="38" justification="0" size="4" underlined="false">
        <text>The MapView class has a MapModel object associated
with it that is used to determine what the screen will
display. It also has a MapController object associated
with it that will react to user input and possibly other
important events.</text>
      </text>
      <color id="39">
        <red>0</red>
        <green>255</green>
        <blue>255</blue>
        <alpha>255</alpha>
      </color>
    </NoteNode>
    <NoteNode id="40">
      <children id="41"/>

      <revision>1</revision>
      <backgroundColor reference="30"/>
      <borderColor reference="31"/>
      <textColor reference="31"/>
      <text id="44" justification="0" size="4" underlined="false">
        <text>The MapController class modifies the MapModel based
on user interactions with the MapView. </text>
      </text>
      <color id="45">
        <red>0</red>
        <green>255</green>
        <blue>127</blue>
        <alpha>255</alpha>
      </color>
    </NoteNode>
    <NoteNode id="46">
      <children id="47"/>
      <location class="Point2D.Double" id="48" x="460.0" y="260.0"/>
      <id id="49" value="e949e72e-6190-4d22-8c00-f6ea3b26458e"/>
      <revision>1</revision>
      <backgroundColor reference="30"/>
      <borderColor reference="31"/>
      <textColor reference="31"/>
      <text id="50" justification="0" size="4" underlined="false">
        <text>The displayModel method merely tells the relevant
components of the model to draw themselves on 
the screen at the proper location.

 In the setupController method, it tells
external APIs to call the various methods of the controller
that correspond to user interaction events.</text>
      </text>

        <green>192</green>

      <textColor reference="79"/>
      <text id="80" justification="0" size="4" underlined="false">
        <text>The MapModel does all the real work behind
the scenes. It maintains the objects that represent 
data. Interacting with the database, it produces the
bubbles for the map, forms a key based on their info,
and applies filters to the bubbles. It can also find all of the
relationships between bubbles. </text>
      </text>
